//provides template for the address of the pixel.
void plot_pixel(int x, int y, short int line_colour) {
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_colour;
}

void plot_character(int x, int y, char ASCII_code) {
    *(char *)(char_buffer_start + (y << 7) + x) = ASCII_code;
}

void draw_line(int x0, int y0, int x1, int y1, short int line_colour) { //contains starting values of the line
    
    bool is_steep = abs(y1-y0) > abs(x1-x0);
    if(is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if(x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }
    
    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax/2);
    
    int y = y0;
    int y_step;
    
    if(y0 < y1) {
        y_step = 1;
    }
    else {
        y_step = -1;
    }
    
    for(int x = x0; x < x1; ++x) {
        if(is_steep) {
            plot_pixel(y, x, line_colour);
        }
        else {
            plot_pixel(x, y, line_colour);
        }
        
        error = error + deltay;
        if(error >= 0) {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

void swap(int *xp, int *yp) {
    int temp = *xp;
    *xp = *yp;
    *yp = temp;
}

void draw_subsquare(int square, int board_position) {
    
    //Square is the part of the image, board_position is the location of the image to be placed
    int square_offset_X = (square % NUM_SQUARES) * SQUARE_SIZE;
    int square_offset_Y = (square / NUM_SQUARES) * SQUARE_SIZE;
    int screen_offset_X = (board_position % NUM_SQUARES) * SQUARE_SIZE;
    int screen_offset_Y = (board_position / NUM_SQUARES) * SQUARE_SIZE;
    
    for(int i = 0; i < SQUARE_SIZE; i++) {
        for(int j = 0; j < SQUARE_SIZE; j++) {
            if(square == 15) {
                plot_pixel(j+screen_offset_X+50, i+screen_offset_Y+10, BLACK);
            }
            else {
                plot_pixel(j+screen_offset_X+50, i+screen_offset_Y+10, full_ghost[i+square_offset_Y][j+square_offset_X]);
            }
        }
    }
}

